import React, { useEffect } from 'react';
import { useHistory } from 'react-router-dom';

import './styles.scss';

export default function Motivation() {

    useEffect(() => {
        document.getElementById("main_sidebar").style.display="none"
        document.getElementById("header_main").style.display="none"
        document.getElementById("header_spacer").style.display="none"
        document.getElementsByTagName("body")[0].style.background="#fff"
        document.getElementById("footer_main").style.marginTop="28em"

        return(() => {
            document.getElementById("footer_main").style.marginTop="auto"
            document.getElementById("main_sidebar").style.display="block"
            document.getElementById("header_main").style.display="block"
            document.getElementById("header_spacer").style.display="block"
            document.getElementsByTagName("body")[0].style.background="#f8f9fc"
            window.location.reload();
        })
    })

